  return (
    <div className="container">
      <h1 className="heading">SUKRIT</h1>
      <p>HyperText Markup Language&ensp;&ensp;&ensp;&ensp;&ensp;Cascading Style Sheets&ensp;&ensp;&ensp;&ensp;&ensp;JavaScript&ensp;&ensp;&ensp;&ensp;&ensp;Responsive Web Design
        <br /> Mobile-First Design&ensp;&ensp;&ensp;&ensp;&ensp;UI (User Interface) Design&ensp;&ensp;&ensp;&ensp;&ensp;UX (User Experience) Design&ensp;&ensp;&ensp;&ensp;&ensp;Front-End Frameworks&ensp;&ensp;&ensp;&ensp;&ensp;Version Control/Git
        <br />Web Accessibility&ensp;&ensp;&ensp;&ensp;&ensp;Cross-Browser Compatibility&ensp;&ensp;&ensp;&ensp;&ensp;CSS Preprocessors&ensp;&ensp;&ensp;&ensp;&ensp;Build Tools&ensp;&ensp;&ensp;&ensp;&ensp;Package Managers
        <br />Front-End Performance Optimization&ensp;&ensp;&ensp;&ensp;&ensp;Browser DevTools&ensp;&ensp;&ensp;&ensp;&ensp;Responsive Images&ensp;&ensp;&ensp;&ensp;&ensp;CSS Grid and Flexbox&ensp;&ensp;&ensp;&ensp;&ensp;Web APIs
        <br />AJAX (Asynchronous JavaScript and XML)&ensp;&ensp;&ensp;&ensp;&ensp;Progressive Web Apps (PWAs)&ensp;&ensp;&ensp;&ensp;&ensp;Typography&ensp;&ensp;&ensp;&ensp;&ensp;Front-End Testing&ensp;&ensp;&ensp;&ensp;Performance Metrics Semantic HTML
        <br />JSX (JavaScript XML)&ensp;&ensp;&ensp;&ensp;Components&ensp;&ensp;&ensp;&ensp;Props(Properties)&ensp;&ensp;&ensp;&ensp;State&ensp;&ensp;&ensp;&ensp;State Management&ensp;&ensp;&ensp;&ensp;Hooks
        <br />Lifecycle Methods&ensp;&ensp;&ensp;&ensp;Functional&ensp;&ensp;&ensp;&ensp;Components&ensp;&ensp;&ensp;&ensp;Context API&ensp;&ensp;&ensp;&ensp;Virtual DOM&ensp;&ensp;&ensp;&ensp;React Router&ensp;&ensp;&ensp;&ensp;Context  Server-Side Rendering(SSR)
      </p>
      <div className='main-button'>
        <button className='main-button'>GET INFO</button>
      </div>
    </div>
  );
};

export default Main;
